pragma solidity ^0.8.17;

import "hardhat/console.sol";
import "@openzeppelin/contracts/token/ERC721/extensions/ERC721Burnable.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/utils/structs/EnumerableSet.sol";
import "@openzeppelin/contracts/security/ReentrancyGuard.sol";

interface UIFCreditsInterface {
    function mint(address _to, uint256 _amount) external;

    function burn(address _from, uint256 _amount) external;
}

contract UniversalInventoryFactory is ERC721Burnable, Ownable, ReentrancyGuard {
    UIFCreditsInterface uifCredits;

    // TODO: Consider allowing each wallet to have a single soulbound slot.
    // When lost, the souldbound item returns after 30 days or so
    // If taken by another player, that player can use it until the end of the
    // game.  Possibly require a bounty payment from the soulbound item's owner?

    // TODO: I'm beginning to think I do need some kind of fungible token here
    // It's important for the economy to destroy items.  Low quality items will
    // be abandoned.  Should have a system where burning 10? items at level 6
    // quality gives you the ability to mint one item capped at level 6 or maybe
    // even level 7.  That's basically a token/currency
    // Could do a direct relationship between quality of items burned and amount
    // needed to raise the level cap.

    // TODO: Interface for showing stats and look for each game's interpretation of this
    // TODO: Random seed will be replaced with a value from an oracle
    // TODO: Add budget for oracle derived from minting fees
    uint private TODO_randomSeed = 0;
    bool public mintIsActive = true; // TODO: Set and add control function

    // TODO: Allowed minters
    // TODO: Fee structure, discounts and allotments for quality level
    // TODO: Build a system to allow legendary (meaning tbd) items to come back?  And or rescue if abandoned?
    // TODO: Tie costs to increase unless user contract decays and destroys them at a set rate
    // TODO: Guidance for spawning these on enemies that use and then drop them
    // TODO: Method and credit for burning unlooted items
    // TODO: Way to handle "blacksmith" users/games/contracts positively
    // Probably just allow direct purchases from end users???
    // Possibly make it open, but require a meaningful deposit to start
    // Expect and handle minting-only efforts
    // Use delta of created vs. destroyed items to impact price
    // Implement different prices for different types Chars/Ships/Castles $$$$$ vs. Items $
    // But figure out how to avoid games just ignoring that and using the cheapest one for everything
    // Maybe build in automatic decay and tie it to type and quality
    // TODO: Make something super special happen if 0xffff.... or 0x33333... etc are ever minted
    // Do that as an explicit check rather than wasting gas checking each one, maybe tie to a system
    // to build/grow/craft legendaries
    // TODO: Add standard items
    // TODO: Add a "consumable" type?
    uint public baseCost = 100 gwei; // for now (goal is to charge dust but ensure rarity)
    uint public recycleCredit = 1;
    uint public creditsBaseCost = 10; // Base if you pay with credits

    event NewItem(); // TODO

    // TODO: Word "owner" is confusing
    // TODO: Handle being in game, and transferring between games
    struct UniversalInventoryItem {
        address originalOwner; // Wallet that minted not erc721 owner // TODO: Keep or discard? And/or research existing provenance strats
        address currentOwner; // Who does this belong to (wallet owner)?  The ERC721 ownerOf will be the game that has the item now
        address creator; // The contract/game, not the person.
        bytes32 properties;
        uint taxonomyVersion; // Might not be relevant
        // TODO: Add decay (use for killing at clone limit, etc.) also for economy
        // TODO: Consider adding full or Tarkov-like repair mechanism
        // TODO: Add last usage timestamp
    }

    UniversalInventoryItem[] public items;

    // TODO: Handle transfers of uiis between owners (while in game)
    // TODO: Handle burned uiis
    // uiisOwned tracks soft owners, IE the player that has the item in the game.
    mapping(address => uint[]) public uiisOwned;

    constructor() ERC721("Universal Inventory Factory", "UIF") {
        // TODO:  Mint and drop an early set of "legendary" items?
        // TODO:  And possibly seed them in early games somehow?
        // TODO:  Mint N giveway NFTs to get things started?
        // Burn item 0
        items.push();
    }

    function setContractAddresses(address _uifCreditsAddress) public onlyOwner {
        uifCredits = UIFCreditsInterface(_uifCreditsAddress);
    }

    function _randKeccak() internal returns (bytes32) {
        TODO_randomSeed++;
        return (
            keccak256(
                abi.encodePacked(TODO_randomSeed, block.timestamp, msg.sender)
            )
        );
    }

    function _generateItemProps(
        uint _type,
        uint _quality
    ) internal returns (bytes32) {
        // TODO: Prevent adjustment of legendary rolls (whatever that ends up being)
        // TODO: Adjust if we use 65k max for quality etc.
        bytes memory properties = abi.encode(_randKeccak());

        properties[0] = bytes1(uint8(_type)); // Make it the first two digits for compatibility with 65k
        // TODO: Allow requesting subcategory
        // TODO: REinterperet quality based off of log scale?
        // TODO: Consider redoing all off log scale?
        // TODO: Or use guidance to put log scale on the interpretation side?
        // TODO: Or have guidance be to interpret other props through quality?
        if (_quality > 0) {
            properties[2] = bytes1(uint8(_quality));
        }

        return bytes32(properties);
    }

    // TODO: CRITICAL -> Reentrancy check!!!
    // TODO: Rename to mintWithNativeTokens
    function mintItem(
        uint _type,
        uint _quality,
        address _minter
    ) public payable returns (uint) {
        require(
            msg.sender == owner() || mintIsActive == true,
            "Minting is not active"
        );

        // TODO: Should credits and tokens use same cost structure?
        uint cost;
        if (_quality == 0) {
            cost = baseCost;
        } else {
            cost = baseCost ** _quality; // TODO: This is temporary.  Balance and make sure this is actually more expensive than random
        }
        string memory paymentError = string(
            abi.encodePacked("Payed: ", msg.value, ", cost is: ", cost)
        );
        require(msg.value == cost, paymentError);

        return _mintItem(_type, _quality, _minter);
    }

    function getCreditsCost(uint _quality) public view returns (uint) {
        uint cost;
        if (_quality == 0) {
            cost = creditsBaseCost;
        } else {
            cost = creditsBaseCost ** _quality; // TODO: This is temporary.  Balance and make sure this is actually more expensive than random
        }
        return cost;
    }

    // TODO: CRITICAL -> UNTESTED!!!!!!
    // TODO: Also not usable, because the deployment doesn't set allowed address
    // TODO: and the ERC20 is not even deployed yet
    function mintWithCredits(
        uint _type,
        uint _quality,
        address _minter
    ) public returns (uint) {
        uint cost = getCreditsCost(_quality);

        string memory paymentError = string(
            abi.encodePacked("Can't afford.  Cost is: ", cost)
        );
        require(balanceOf(msg.sender) >= cost, paymentError);

        // TODO: This is going to need authorization
        // TODO: CRITICAL -> Should I have this return true to confirm it worked?
        uifCredits.burn(msg.sender, cost);

        return _mintItem(_type, _quality, _minter);
    }

    // 0 _quality == random quality
    // Anything else will have cost or restrictions
    // TODO: Less random options with cost structure
    // TODO: Figure out name generation (look generation will be based off props)
    // TYPE MUST BE SPECIFIED - O is NOT random!
    function _mintItem(
        uint _type,
        uint _quality,
        address _minter
    ) internal nonReentrant returns (uint) {
        require(
            msg.sender == owner() || mintIsActive == true,
            "Minting is not active"
        );
        // TODO: Remove free owner minting
        require(_type <= 255, "Bad type value"); // TODO: Do we need or want all 65k values for these?
        require(_quality <= 15, "Bad quality value");

        items.push(
            UniversalInventoryItem(
                _minter,
                _minter,
                msg.sender,
                _generateItemProps(_type, _quality),
                0 // TODO: Logic to handle taxonomy version, possibly method to update
            )
        );

        // Track items belonging to minter that are owned on their behalf
        uiisOwned[_minter].push(items.length - 1);
        // TODO: Event

        // console.log("Minting UII number %d of type %d for %s", items.length-1, _type, msg.sender);
        // Owner is the CONTRACT calling!!!
        _safeMint(msg.sender, items.length - 1);

        return (items.length - 1);
    }

    function recycle(uint _id) public {
        require(msg.sender == ownerOf(_id), "Not your nft"); // Might be redundent with burn
        _burn(_id);
        _mint(msg.sender, recycleCredit);
    }

    // Sets the currentOwner within the item struct, not NFT owner
    function setCurrentOwner(
        address _newOwner,
        address _oldOwner,
        uint _id
    ) public {
        // TODO: Critical -> Needs thorough testing

        // NOTE: The owner here is probably part of a game's contract
        // Need to check for side effects of a non-game owner messing with this
        require(msg.sender == ownerOf(_id), "Not your nft");
        items[_id].currentOwner = _newOwner;
        // Remove the item from owner to item
        // TODO: Consider just deleting the item, but this would require
        // TODO: assumption 0 is burned and impact front end and data transfer amount
        // TODO: Cost of making an extra array vs writing to memory in place
        uint[] memory modifiedArray = new uint[](
            uiisOwned[_oldOwner].length - 1
        );
        uint found = 0;

        for (uint i = 0; i < uiisOwned[_oldOwner].length; i++) {
            if (uiisOwned[_oldOwner][i] == _id) {
                found++;
                continue;
            }
            modifiedArray[i - found] = uiisOwned[_oldOwner][i];
        }
        uiisOwned[_oldOwner] = modifiedArray;

        uiisOwned[_newOwner].push(_id);
    }

    function extGetListOfUIIsOwned(
        address _currentOwner
    ) public view returns (uint[] memory) {
        return uiisOwned[_currentOwner];
    }

    function extGetItem(
        uint _id
    ) public view returns (UniversalInventoryItem memory) {
        return items[_id];
    }

    function extGetProperties(uint _id) public view returns (bytes32) {
        return items[_id].properties;
    }

    function extGetCurrentOwner(uint _id) public view returns (address) {
        return items[_id].currentOwner;
    }

    function setCreditsBaseCost(uint _newCost) public onlyOwner {
        creditsBaseCost = _newCost;
    }

    function setRecycleCredit(uint _newCredit) public onlyOwner {
        recycleCredit = _newCredit;
    }

    function setBaseCost(uint _newCost) public onlyOwner {
        baseCost = _newCost;
    }

    function transferFundsOut() public onlyOwner {
        payable(owner()).transfer(address(this).balance);
    }
}
